INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(2, 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Hữu nghị Việt Đức', 'GIỚI THIỆUĐịa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà NộiThời gian làm việc: Thứ 2 đến thứ 7Sáng: 7h00 - 12h00Chiều: 13h30 - 16h30Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. Lưu ý quan trọngBệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.', '<p>GIỚI THIỆU</p><p>Địa chỉ:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p><p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà NộiThời gian làm việc: Thứ 2 đến thứ 7</p><p>Sáng: 7h00 - 12h00Chiều: 13h30 - 16h30Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p><p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p><p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p><p>Lưu ý quan trọng</p><p>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:01:34', '2021-08-11 18:01:34');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(3, '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', 'Phòng khám Bệnh viện Đại học Y Dược 1', 'GIỚI THIỆUĐịa chỉ: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí MinhThời gian làm việcThứ 2 tới thứ 6: 07h30 - 16h30Thứ 7: 07h30 - 12h00Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.Lưu ý quan trọngNgười bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.', '<p>GIỚI THIỆU</p><p>Địa chỉ: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p><p>Thời gian làm việc</p><p>Thứ 2 tới thứ 6: 07h30 - 16h30Thứ 7: 07h30 - 12h00Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p><p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và một số bệnh viện tên tuổi khác.</p><p>Lưu ý quan trọng</p><p>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.Khi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:02:11', '2021-08-11 18:02:11');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(4, '9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội', 'Bệnh viện K - Cơ sở Phan Chu Trinh', 'GIỚI THIỆUĐịa chỉ: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà NộiThời gian làm việc: Thứ 2 đến thứ 7 (6h00 - 17h00)Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:Cấp cứu, khám bệnh, chữa bệnh, phòng bệnhPhục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau:Gói 1:Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khámGói 2:Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khámGói 3:Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám', '<p>GIỚI THIỆU</p><p>Địa chỉ: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội</p><p>Thời gian làm việc: Thứ 2 đến thứ 7 (6h00 - 17h00)</p><p>Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:</p><p>Cấp cứu, khám bệnh, chữa bệnh, phòng bệnhPhục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.Người bệnh có thể lựa chọn một trong các mức khám theo yêu cầu sau:</p><p>Gói 1:Khám Giáo sư, Phó Giáo sư - Chi phí: 500.000 đồng/lần khámGói 2:Khám Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí: 300.000 đồng/lần khámGói 3:Khám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 200.000 đồng/ lần khám</p>', 'data:image/jpeg;base64,', '2021-08-11 18:02:48', '2021-08-11 18:02:48');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(5, 'Số 1 Trần Hưng Đạo, Hai Bà Trưng, Hà Nội', 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', 'Giới thiệuĐịa chỉ: Số 1 Trần Hưng Đạo, Hai Bà Trưng, Hà NộiThời gian làm việc:6h30 - 17h00 (nên đến khám trước 14h00 để kịp làm các xét nghiệm, chụp chiếu)Khám cá nhân: Thứ 2 - Thứ 6Khám đoàn và công ty: Thứ 7Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám tổng quát. Vì vậy, Trung tâm khám sức khỏe định kỳ của bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát.Khám trực tiếp cho người bệnh tại Trung tâm là các Giáo sư, Phó Giáo sư, bác sĩ giỏi của Bệnh viện Trung ương Quân đội 108. Bên cạnh đó, hệ thống trang thiết bị hiện đại, đồng bộ, riêng biệt tạo ra sự thuận tiện cho người khám sức khỏe định kỳ. Trung tâm có nơi lấy mẫu xét nghiệm riêng biệt, người khám được ưu tiên với các xét nghiệm chụp chiếu khác, chính vì vậy người khám sẽ không phải chờ đợi quá lâu khi đi khám sức khỏe.', '<p>Giới thiệu</p><p>Địa chỉ: Số 1 Trần Hưng Đạo, Hai Bà Trưng, Hà Nội</p><p>Thời gian làm việc:</p><p>6h30 - 17h00 (nên đến khám trước 14h00 để kịp làm các xét nghiệm, chụp chiếu)Khám cá nhân: Thứ 2 - Thứ 6Khám đoàn và công ty: Thứ 7Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám tổng quát. Vì vậy, Trung tâm khám sức khỏe định kỳ của bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát.</p><p>Khám trực tiếp cho người bệnh tại Trung tâm là các Giáo sư, Phó Giáo sư, bác sĩ giỏi của Bệnh viện Trung ương Quân đội 108. Bên cạnh đó, hệ thống trang thiết bị hiện đại, đồng bộ, riêng biệt tạo ra sự thuận tiện cho người khám sức khỏe định kỳ.</p><p>Trung tâm có nơi lấy mẫu xét nghiệm riêng biệt, người khám được ưu tiên với các xét nghiệm chụp chiếu khác, chính vì vậy người khám sẽ không phải chờ đợi quá lâu khi đi khám sức khỏe.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:03:34', '2021-08-11 18:03:34');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(6, '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Bệnh viện Ung bướu Hưng Việt', 'GIỚI THIỆUĐịa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà NộiThời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)Buổi sáng: 07h00 - 12h00Buổi chiều: 13h30 - 17h00Bệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. Một trong những điểm mạnh giúp Bệnh viên Ung bướu Hưng Việt trở thành điểm sáng về khám chữa bệnh là đội ngũ y bác sĩ giỏim uy tín. Các bác sĩ trực tiếp thăm khám, phẫu thuật cho bệnh nhân đều là những chuyên gia đã đang làm việc tại các bệnh viện lớn như: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Đại học Y Hà Nội, Bệnh viện Hữu nghị Việt Đức, Bệnh viên Quân đội 108,...Bên cạnh đó, bệnh nhân có thể an tâm tới khám và điều trí nội trú, ngoại trú vì bệnh viện hệ thống cơ sở vật chất đầy đủ, tiên nghi đạt tiêu chuẩn tiên tiến song song với đó là trang thiết bị y tế hiện đại nhập khẩu từ Mỹ, Châu Âu.', '<p>GIỚI THIỆU</p><p>Địa chỉ: Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p><p>Thời gian làm việc: Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p><p>Buổi sáng: 07h00 - 12h00Buổi chiều: 13h30 - 17h00Bệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p><p>Một trong những điểm mạnh giúp Bệnh viên Ung bướu Hưng Việt trở thành điểm sáng về khám chữa bệnh là đội ngũ y bác sĩ giỏim uy tín. Các bác sĩ trực tiếp thăm khám, phẫu thuật cho bệnh nhân đều là những chuyên gia đã đang làm việc tại các bệnh viện lớn như: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Đại học Y Hà Nội, Bệnh viện Hữu nghị Việt Đức, Bệnh viên Quân đội 108,...</p><p>Bên cạnh đó, bệnh nhân có thể an tâm tới khám và điều trí nội trú, ngoại trú vì bệnh viện hệ thống cơ sở vật chất đầy đủ, tiên nghi đạt tiêu chuẩn tiên tiến song song với đó là trang thiết bị y tế hiện đại nhập khẩu từ Mỹ, Châu Âu.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:04:04', '2021-08-11 18:04:04');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(7, 'Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà Nội Cơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội Cơ sở 3: 32 Đại Từ, Hoàng Mai, Hà Nội', 'Hệ thống Y tế Thu Cúc', 'Địa chỉ:Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà NộiCơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà NộiCơ sở 3: 32 Đại Từ, Hoàng Mai, Hà NộiThời gian làm việc chung:Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc triển khai giờ làm việc như sau:Bệnh viện Đa khoa Quốc tế Thu Cúc - 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7Phòng khám Đa khoa Quốc tế Thu Cúc - 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuầnPhòng khám Đa khoa Thu Cúc - 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuầnHệ thống Y tế Thu Cúc hướng mục tiêu trở thành một trong những đơn vị khám chữa bệnh hàng đầu trong cả nước, địa chỉ khám chữa bệnh uy tín cho người dân. Các cơ sở thăm khám của Hệ thống Y tế Thu Cúc được đầu tư trang bị y tế hiện đại, đạt tiêu chuẩn quốc tế, kết hợp với đội ngũ bác sĩ giỏi nhằm đưa đến kết quả khám bệnh chính xác nhất và điều trị bệnh tốt nhất cho người dân. Đồng thời, tạo một môi trường y tế an toàn, thân thiện, chất lượng cao hơn cho tất cả mọi người.', '<p>Địa chỉ:</p><p>Cơ sở 1: 286 Thụy Khuê, Tây Hồ, Hà NộiCơ sở 2: 216 Trần Duy Hưng, Cầu Giấy, Hà NộiCơ sở 3: 32 Đại Từ, Hoàng Mai, Hà NộiThời gian làm việc chung:</p><p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc triển khai giờ làm việc như sau:</p><p>Bệnh viện Đa khoa Quốc tế Thu Cúc - 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7Phòng khám Đa khoa Quốc tế Thu Cúc - 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuầnPhòng khám Đa khoa Thu Cúc - 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuầnHệ thống Y tế Thu Cúc hướng mục tiêu trở thành một trong những đơn vị khám chữa bệnh hàng đầu trong cả nước, địa chỉ khám chữa bệnh uy tín cho người dân. Các cơ sở thăm khám của Hệ thống Y tế Thu Cúc được đầu tư trang bị y tế hiện đại, đạt tiêu chuẩn quốc tế, kết hợp với đội ngũ bác sĩ giỏi nhằm đưa đến kết quả khám bệnh chính xác nhất và điều trị bệnh tốt nhất cho người dân. Đồng thời, tạo một môi trường y tế an toàn, thân thiện, chất lượng cao hơn cho tất cả mọi người.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:04:38', '2021-08-11 18:04:38');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(8, '431 Tam Trinh (Lô 01 – 8A),Hoàng Mai, Hà Nội', 'Bệnh viện Nam học và Hiếm muộn Hà Nội', 'Địa chỉ: 431 Tam Trinh (Lô 01-8A cụm tiểu thủ công nghiệp Hai Bà Trưng),Phường Hoàng Văn Thụ, Quận Hoàng Mai, Hà NộiThời gian làm việc: Từ thứ 2 - Thứ 7: 7h30 - 17h00 (Làm cả buổi trưa)Sáng Chủ nhật:7h30 - 12h00Bệnh viện Nam Học và Hiếm Muộn Hà Nội (Andrology And Fertility Hospital Of Hanoi) thành lập năm 2009 với chức năng điều trị bệnh lý Nam khoa & Y học giới tính, Sức khỏe sinh sản và Vô sinh – Hiếm muộn (cho cả nam và nữ). Bệnh viện là cơ sở y tế ngoài công lập đầu tiên ở Miền Bắc được cấp phép thực hiện Kỹ thuật Thụ tinh trong ống nghiệm (TTTON).Từ 2009 đến nay, Bệnh viện đã đón tiếp hàng chục nghìn lượt bệnh nhân tới khám, chữa bệnh và hàng ngàn cặp vợ chồng thực hiện kĩ thuật TTTON với tỷ lệ thành công rất cao (tương đương với tỷ lệ của các trung tâm thụ tinh ống nghiệm lớn trong nước và quốc tế) nhờ các phác đồ điều trị và can thiệp y khoa thích hợp.', '<p>Địa chỉ: 431 Tam Trinh (Lô 01-8A cụm tiểu thủ công nghiệp Hai Bà Trưng),Phường Hoàng Văn Thụ, Quận Hoàng Mai, Hà Nội</p><p>Thời gian làm việc:</p><p>Từ thứ 2 - Thứ 7: 7h30 - 17h00 (Làm cả buổi trưa)Sáng Chủ nhật:7h30 - 12h00Bệnh viện Nam Học và Hiếm Muộn Hà Nội (Andrology And Fertility Hospital Of Hanoi) thành lập năm 2009 với chức năng điều trị bệnh lý Nam khoa &amp; Y học giới tính, Sức khỏe sinh sản và Vô sinh – Hiếm muộn (cho cả nam và nữ). Bệnh viện là cơ sở y tế ngoài công lập đầu tiên ở Miền Bắc được cấp phép thực hiện Kỹ thuật Thụ tinh trong ống nghiệm (TTTON).</p><p>Từ 2009 đến nay, Bệnh viện đã đón tiếp hàng chục nghìn lượt bệnh nhân tới khám, chữa bệnh và hàng ngàn cặp vợ chồng thực hiện kĩ thuật TTTON với tỷ lệ thành công rất cao (tương đương với tỷ lệ của các trung tâm thụ tinh ống nghiệm lớn trong nước và quốc tế) nhờ các phác đồ điều trị và can thiệp y khoa thích hợp.</p>', 'data:image/jpeg;base64,', '2021-08-11 18:05:08', '2021-08-11 18:05:08');
INSERT INTO Clinics (Clinics.id, Clinics.address, Clinics.name, Clinics.descriptionMarkdown, Clinics.descriptionHTML, Clinics.image, Clinics.createdAt, Clinics.updatedAt) VALUES
(9, 'Số 1E Trường Chinh - Thanh Xuân - Hà Nội', 'Bệnh viện Đa khoa An Việt', 'Địa chỉ: Số 1E Trường Chinh, Thanh Xuân, Hà NộiThời gian làm việc: Thứ 2 đến Chủ NhậtSáng: Từ 7h30 – 12h00Chiều: Từ 13h30 – 16h30Bệnh viện Đa khoa An Việt là bệnh viện Đa khoa tư nhân với đội ngũ bác sĩ từ các bệnh viện lớn trên địa bàn thành phố Hà Nội: Bệnh viện Tai mũi họng Trung ương, Bệnh viện Phụ sản Trung ương, Bệnh viện K, Bệnh viện Việt Đức,... Bệnh viện được đánh giá cao về sự đầu tư cơ sở hạ tầng và trang thiết bị. Bệnh viện được định hướng trở thành bệnh viện top đầu về chuyên môn và công nghệ, đạt tiêu chuẩn cao nhất về quản lý chất lượng và an toàn cho bệnh nhân. Lưu ý khi đi khámNên mang theo thẻ bảo hiểm y tế hoặc thẻ bảo hiểm bảo lãnh', '<p>Địa chỉ: Số 1E Trường Chinh, Thanh Xuân, Hà Nội</p><p>Thời gian làm việc: Thứ 2 đến Chủ Nhật</p><p>Sáng: Từ 7h30 – 12h00Chiều: Từ 13h30 – 16h30Bệnh viện Đa khoa An Việt là bệnh viện Đa khoa tư nhân với đội ngũ bác sĩ từ các bệnh viện lớn trên địa bàn thành phố Hà Nội: Bệnh viện Tai mũi họng Trung ương, Bệnh viện Phụ sản Trung ương, Bệnh viện K, Bệnh viện Việt Đức,... Bệnh viện được đánh giá cao về sự đầu tư cơ sở hạ tầng và trang thiết bị. Bệnh viện được định hướng trở thành bệnh viện top đầu về chuyên môn và công nghệ, đạt tiêu chuẩn cao nhất về quản lý chất lượng và an toàn cho bệnh nhân.</p><p>Lưu ý khi đi khám</p><p>Nên mang theo thẻ bảo hiểm y tế hoặc thẻ bảo hiểm bảo lãnh</p>', 'data:image/jpeg;base64,', '2021-08-11 18:05:35', '2021-08-11 18:05:35');
