(5, '<h3><strong>1. Bác sĩ Nguyễn Kim Hằng</strong></h3><ul><li><p>Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Cơ Xương khớp</p></li><li><p>Bác sĩ từng công tác tại Bệnh viện Bạch Mai</p></li><li><p>Nguyên Trưởng khoa Cơ Xương Khớp - Bệnh Viện Bạch Mai</p></li><li><p>Chủ tịch Hội loãng xương Hà Nội</p></li><li><p>Bác sĩ nhận bệnh nhân từ 18 tuổi trở lên</p></li></ul><h3><strong>2. Quá trình đào tạo</strong></h3><ul><li><p>Tốt nghiệp Đại học Y Hà Nội năm 1976</p></li><li><p>Bác sĩ Chuyên khoa cấp I năm 1987, chuyên khoa cấp II năm 1991</p></li><li><p>Tiến sỹ Y khoa năm 1997</p></li><li><p>Danh hiệu phó Giáo sư năm 2007</p></li><li><p>Chứng chỉ trong nước hoặc nước ngoài</p></li><li><p>Tu nghiệp tại Australia về Chuyên ngành Cơ Xương Khớp</p></li><li><p>Tham gia các Hội thảo, đào tạo ngắn hạn về Chuyên ngành Cơ Xương Khớp tại nhiều quốc gia như Mỹ, Pháp, Đức, Indonesia, Thái Lan, Singapore, Malaysia</p></li></ul><h3><strong>3.Quá trình công tác</strong></h3><ul><li><p>Bác sĩ công tác tại Bệnh viện Bạch Mai (Năm 1976-2010)</p></li><li><p>Nguyên trưởng khoa Cơ Xương Khớp - Bệnh Viện Bạch Mai</p></li><li><p>Hiện nay là Trưởng khoa Cơ-Xương-Khớp - Bệnh viện Đông Đô</p></li><li><p>Sách và các công trình nghiên cứu, báo cáo khoa học</p></li><li><p>Chủ biên cuốn sách: Bệnh lý Cơ Xương Khớp thường gặp</p></li><li><p>Tác giả trên 50 bài báo khoa học về Chuyên ngành Cơ Xương Khớp</p></li><li><p>Tác giả nhiều bài báo về Loãng xương</p></li><li><p>Thành viên các Hội khoa học, tổ chức chuyên môn</p></li><li><p>Chủ tịch Hội Loãng xương Hà Nội</p></li><li><p>Ủy viên Ban chấp hành Hội Thấp khớp học Việt Nam</p></li><li><p>Thành viên Tổ chức Loãng xương thế giới</p></li><li><p>Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình</p></li><li><p>Thường xuyên tư vấn trên truyền hình VTV2</p></li><li><p>Đài Phát thanh tiếng nói Việt Nam về Cơ Xương Khớp</p></li></ul><h3><strong>4. Khám, điều trị các bệnh</strong></h3><ul><li><p>Bệnh về Khớp</p></li><li><p>Gout (Gút)</p></li><li><p>Viêm cột sống dính khớp</p></li><li><p>Thoái hóa khớp</p></li><li><p>Viêm khoanh khớp vai</p></li><li><p>Đau khớp vai, đau vai gáy</p></li><li><p>Lupus ban đỏ, đau thắt lưng, đau xương khớp</p></li><li><p>Thoát vị đĩa đệm, viêm khớp</p></li><li><p>Bệnh về Xương</p></li><li><p>Loãng xương, đau nhức xương</p></li><li><p>Viêm xương, gai xương, vôi hóa cột sống</p></li><li><p>Chấn thương thể thao</p></li><li><p>Bệnh về Cơ</p></li><li><p>Chứng đau mỏi cơ</p></li><li><p>Yếu cơ, Loạn dưỡng cơ</p></li><li><p>Viêm cơ, Teo cơ</p></li></ul><p><strong>Các triệu chứng - biểu hiện sau:</strong></p><ul><li><p>Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)</p></li><li><p>Đau gối, Đau háng, Đau cột sống cổ, Đau hông</p></li><li><p>Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay</p></li><li><p>Đau khớp thái dương hàm</p></li><li><p>Đau lưng, Đau các ngón chân, bàn chân</p></li><li><p>Đau thần kinh tọa</p></li><li><p>Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng</p></li><li><p>Hội chứng cổ vai cánh tay</p></li></ul><p><strong>Một vài hình ảnh về phòng khám bệnh của bác sĩ:</strong></p><p><img src=https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true alt=img></p>', '### **1. Bác sĩ Nguyễn Kim Hằng*** Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Cơ Xương khớp* Bác sĩ từng công tác tại Bệnh viện Bạch Mai* Nguyên Trưởng khoa Cơ Xương Khớp - Bệnh Viện Bạch Mai* Chủ tịch Hội loãng xương Hà Nội* Bác sĩ nhận bệnh nhân từ 18 tuổi trở lên### **2. Quá trình đào tạo*** Tốt nghiệp Đại học Y Hà Nội năm 1976* Bác sĩ Chuyên khoa cấp I năm 1987, chuyên khoa cấp II năm 1991* Tiến sỹ Y khoa năm 1997* Danh hiệu phó Giáo sư năm 2007* Chứng chỉ trong nước hoặc nước ngoài* Tu nghiệp tại Australia về Chuyên ngành Cơ Xương Khớp* Tham gia các Hội thảo, đào tạo ngắn hạn về Chuyên ngành Cơ Xương Khớp tại nhiều quốc gia như Mỹ, Pháp, Đức, Indonesia, Thái Lan, Singapore, Malaysia### **3.Quá trình công tác*** Bác sĩ công tác tại Bệnh viện Bạch Mai (Năm 1976-2010)* Nguyên trưởng khoa Cơ Xương Khớp - Bệnh Viện Bạch Mai* Hiện nay là Trưởng khoa Cơ-Xương-Khớp - Bệnh viện Đông Đô* Sách và các công trình nghiên cứu, báo cáo khoa học* Chủ biên cuốn sách: Bệnh lý Cơ Xương Khớp thường gặp* Tác giả trên 50 bài báo khoa học về Chuyên ngành Cơ Xương Khớp* Tác giả nhiều bài báo về Loãng xương* Thành viên các Hội khoa học, tổ chức chuyên môn* Chủ tịch Hội Loãng xương Hà Nội* Ủy viên Ban chấp hành Hội Thấp khớp học Việt Nam* Thành viên Tổ chức Loãng xương thế giới* Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình* Thường xuyên tư vấn trên truyền hình VTV2* Đài Phát thanh tiếng nói Việt Nam về Cơ Xương Khớp### **4. Khám, điều trị các bệnh*** Bệnh về Khớp* Gout (Gút)* Viêm cột sống dính khớp* Thoái hóa khớp* Viêm khoanh khớp vai* Đau khớp vai, đau vai gáy* Lupus ban đỏ, đau thắt lưng, đau xương khớp* Thoát vị đĩa đệm, viêm khớp* Bệnh về Xương* Loãng xương, đau nhức xương* Viêm xương, gai xương, vôi hóa cột sống* Chấn thương thể thao* Bệnh về Cơ* Chứng đau mỏi cơ* Yếu cơ, Loạn dưỡng cơ* Viêm cơ, Teo cơ**Các triệu chứng - biểu hiện sau:*** Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)* Đau gối, Đau háng, Đau cột sống cổ, Đau hông* Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay* Đau khớp thái dương hàm* Đau lưng, Đau các ngón chân, bàn chân* Đau thần kinh tọa* Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng* Hội chứng cổ vai cánh tay**Một vài hình ảnh về phòng khám bệnh của bác sĩ:**![img](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/46195.jpg?raw=true)', 'Hiên nay Bác sĩ Nguyễn Kim Hằng Nguyên Trưởng khoa Cơ - Xương - Khớp, Bệnh viện Bạch Mai, và  Chủ tịch Hội loãng xương Hà Nội tại Việt Nam với hơn 10 năm kinh nghiêm. Bác sĩ nhận bệnh nhân từ 18 tuổi trở lên và không khám cho trẻ em.', 46, NULL, NULL, '2021-07-17 08:54:36', '2021-07-25 14:08:23'),
