(9, '<h2><strong>Bác sĩ Chuyên khoa II Hỏi Dân IT với Eric</strong></h2><ul><li>Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội</li><li>Được phong tặng Danh hiệu thầy thuốc Ưu tú</li><li>Từng là thực tập sinh tại Ucraina</li><li>Bác sĩ khám cho người bệnh từ 16 tuổi trở lên</li></ul><h3>Quá trình đào tạo</h3><ul><li>Tốt nghiệp Đại học Y Hà Nội (1970)</li><li>Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)</li></ul><h3>Quá trình công tác</h3><ul><li>Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li><li>Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li></ul><h3>Giải thưởng</h3><ul><li>Danh hiệu thầy thuốc Ưu tú</li><li>Chiến sĩ thi đua ngành y tế</li></ul><h2>Khám và điều trị</h2><p><strong>Bệnh về Khớp</strong></p><ul><li>Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai</li><li>Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp</li><li>Thoát vị đĩa đệm, viêm khớp</li></ul><p><strong>Bệnh về Xương</strong></p><ul><li>Loãng xương, đau nhức xương</li><li>Viêm xương, gai xương, vôi hóa cột sống</li><li>Chấn thương thể thao</li></ul><p><strong>Bệnh về Cơ</strong></p><ul><li>Chứng đau mỏi cơ</li><li>Yếu cơ, Loạn dưỡng cơ</li><li>Viêm cơ, Teo cơ</li></ul><p><strong>Các triệu chứng - biểu hiện sau:</strong></p><ul><li>Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)</li><li>Loãng xương</li><li>Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông</li><li>Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay</li><li>Đau khớp thái dương hàm</li><li>Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân</li><li>Đau thần kinh tọa</li><li>Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng</li><li>Đau cánh tay</li><li>Hội chứng vai tay, Hội chứng cổ vai cánh tay</li><li>Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn,Viêm sụn ức sườn, Đau bả vai</li><li>Bệnh Gout</li><li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li><li>Đau nhiều khớp</li><li>Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch</li><li>Đau xương bánh chè</li><li>Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống</li><li>Xơ cứng bì toàn thân</li><li>Viêm đa cơ, Viêm da cơ, tổn thương da</li><li>Viêm khớp vùng chậu</li><li>Viêm khớp thiếu niên (đi khập khiễng)</li><li>Viêm khớp nhiễm khuẩn</li><li>Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)</li><li>Viêm cột sống dính khớp</li><li>Loạn dưỡng cơ tiến triển</li></ul><p><strong>Một vài hình ảnh về phòng khám chữa bệnh của bác sĩ:</strong></p><ol><li><p>Địa chỉ phòng khám<img src=https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a2.jpg?raw=true alt=></p></li><li><p>Chăm sóc khách hàng<img src=https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a1.jpg?raw=true alt=></p></li><li><p>Cơ sở vật chất<img src=https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a4.jpg?raw=true alt=></p></li></ol>', '**Bác sĩ Chuyên khoa II Hỏi Dân IT với Eric**------------------------------------------   Nguyên Trưởng khoa Cơ Xương Khớp và Nội tổng hợp Bệnh viện E Hà Nội-   Được phong tặng Danh hiệu thầy thuốc Ưu tú-   Từng là thực tập sinh tại Ucraina-   Bác sĩ khám cho người bệnh từ 16 tuổi trở lên### Quá trình đào tạo-   Tốt nghiệp Đại học Y Hà Nội (1970)-   Tốt nghiệp Bác sĩ Chuyên khoa II, Học viện Quân Y (1997)### Quá trình công tác-   Làm việc tại khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội-   Nguyên Trưởng khoa cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội### Giải thưởng-   Danh hiệu thầy thuốc Ưu tú-   Chiến sĩ thi đua ngành y tếKhám và điều trị----------------**Bệnh về Khớp**-   Gout, Viêm cột sống dính khớp, thoái hóa khớp, viêm khoanh khớp vai-   Đau khớp vai, đau vai gáy, Lupus ban đỏ, đau thắt lưng, đau xương khớp-   Thoát vị đĩa đệm, viêm khớp**Bệnh về Xương**-   Loãng xương, đau nhức xương-   Viêm xương, gai xương, vôi hóa cột sống-   Chấn thương thể thao**Bệnh về Cơ**-   Chứng đau mỏi cơ-   Yếu cơ, Loạn dưỡng cơ-   Viêm cơ, Teo cơ**Các triệu chứng - biểu hiện sau:**-   Thoái hóa khớp (khớp gối, cột sống thắt lưng, cột sống cổ)-   Loãng xương-   Đau vai gáy, Đau thắt lưng, Đau gối, Đau háng, Đau cột sống cổ, Đau hông-   Đau cổ chân, Đau khủy tay, Đau bàn tay, cổ tay, Đau các ngón tay-   Đau khớp thái dương hàm-   Đau lưng, Đau vai, Đau các ngón chân, Đau cổ chân, bàn chân-   Đau thần kinh tọa-   Thoát vị đĩa đệm cột sống cổ, cột sống thắt lưng-   Đau cánh tay-   Hội chứng vai tay, Hội chứng cổ vai cánh tay-   Đau thần kinh liên sườn, Đau ngực, Đau sụn ức sườn,Viêm sụn ức sườn, Đau bả vai-   Bệnh Gout-   Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân-   Đau nhiều khớp-   Hoại tử vô khuẩn chỏm xương đùi, Hoại tử vô mạch-   Đau xương bánh chè-   Luput ban đỏ hệ thống, Lulus ban đỏ hệ thống-   Xơ cứng bì toàn thân-   Viêm đa cơ, Viêm da cơ, tổn thương da-   Viêm khớp vùng chậu-   Viêm khớp thiếu niên (đi khập khiễng)-   Viêm khớp nhiễm khuẩn-   Viêm màng hoạt dịch (khớp gối, háng, cổ chân, khớp khủy)-   Viêm cột sống dính khớp-   Loạn dưỡng cơ tiến triển**Một vài hình ảnh về phòng khám chữa bệnh của bác sĩ:**1. Địa chỉ phòng khám![](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a2.jpg?raw=true)2. Chăm sóc khách hàng![](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a1.jpg?raw=true)3. Cơ sở vật chất![](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a4.jpg?raw=true)', 'Giáo sư, tiến sỹ Hỏi Dân IT với Eric là tác giả của channel Hỏi Dân IT. Mọi thắc, câu hỏi cần hỗ trợ và đáp, các bạn vui lòng liên qua fanpage Facebook hoặc tham gia group học tập Facebook. Link thông tin liên hệ tại phần miêu tả và comment cùa video.', 62, NULL, NULL, '2021-08-16 15:36:11', '2021-08-16 15:40:34');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(3, 'data:image/jpeg;base64,', 'Cơ Xương Khớp', '<h2>Cơ Xương Khớp</h2><p>Bác sĩ Cơ Xương Khớp giỏi</p><p>Danh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệm</p><p>Các giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà Nội</p><p>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch</p><p>Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Cơ Xương Khớp</p><p>GoutThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổViêm khớp dạng thấp, Viêm đa khớp, Viêm gânTràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vaiLoãng xương, đau nhức xươngViêm xương, gai xươngViêm cơ, Teo cơ, chứng đau mỏi cơYếu cơ, Loạn dưỡng cơCác chấn thương về cơ, xương, khớp</p>', '## Cơ Xương KhớpBác sĩ Cơ Xương Khớp giỏiDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệmCác giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Cơ Xương KhớpGoutThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổViêm khớp dạng thấp, Viêm đa khớp, Viêm gânTràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vaiLoãng xương, đau nhức xươngViêm xương, gai xươngViêm cơ, Teo cơ, chứng đau mỏi cơYếu cơ, Loạn dưỡng cơCác chấn thương về cơ, xương, khớp', '2021-08-08 08:57:59', '2021-08-08 08:57:59');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(4, 'data:image/jpeg;base64,', 'Thần kinh', '<h2>Thần kinh</h2><p>Bác sĩ Thần kinh giỏiDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p><p>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.Khám bệnh chuyên khoa Thần kinhBại Não<br>Đau đầu, chóng mặt, buồn nôn<br>Bệnh Pakison, bệnh tiền đình<br>Bị co cơ, căng dây thần kinh<br>Động kinh, có những cơn vãng ý thức<br>Bị tê bì nửa mặt, chèn dây thần kinhBồn chồn, lo lắng, hồi hộp, chân tay run<br>Có dấu hiệu tăng động<br>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi<br>Chấn thương đầu, dây thần kinh</p>', '## Thần kinhBác sĩ Thần kinh giỏiDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.Khám bệnh chuyên khoa Thần kinhBại Não   Đau đầu, chóng mặt, buồn nôn   Bệnh Pakison, bệnh tiền đình   Bị co cơ, căng dây thần kinh       Động kinh, có những cơn vãng ý thức   Bị tê bì nửa mặt, chèn dây thần kinhBồn chồn, lo lắng, hồi hộp, chân tay run   Có dấu hiệu tăng động    Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   Chấn thương đầu, dây thần kinh', '2021-08-08 08:59:53', '2021-08-08 08:59:53');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(5, 'data:image/jpeg;base64,', 'Tiêu hóa', '<p><strong>Tiêu hóa</strong></p><p>Bác sĩ Chuyên khoa Tiêu hóaDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...Tư vấn, khám và điều trị các Bệnh Tiêu hóa</p><p>Ăn uống kém, không ngonRối loạn tiêu hóa, táo bón, trĩNhiễm vi khuẩn HP (Helicobacter pylori)Nội soi dạ dày, đại tràng, tiêu hóaBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơiCo thắt thực quản, Hội chứng ruột kích thíchĐau bụng, dạ dày, đại tràng, thượng vịViêm đại tràng, dạ dày, tá tràngUng thư dạ dày, U nang tuyến tụyBệnh lý về gan, mật</p>', '**Tiêu hóa**Bác sĩ Chuyên khoa Tiêu hóaDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...Tư vấn, khám và điều trị các Bệnh Tiêu hóaĂn uống kém, không ngonRối loạn tiêu hóa, táo bón, trĩNhiễm vi khuẩn HP (Helicobacter pylori)Nội soi dạ dày, đại tràng, tiêu hóaBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơiCo thắt thực quản, Hội chứng ruột kích thíchĐau bụng, dạ dày, đại tràng, thượng vịViêm đại tràng, dạ dày, tá tràngUng thư dạ dày, U nang tuyến tụyBệnh lý về gan, 