INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(6, 'data:image/jpeg;base64,', 'Tim mạch', '<p><strong>Tim mạch</strong></p><p>Bác sĩ tim mạch giỏiDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà NộiLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt NamĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Khám tư vấn tim mạch</p><p>Khó thở, Đau ngực, đau timTăng huyết áp, hạ huyết ápRối loạn mỡ máu, cao huyết áp, chóng mặtBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủCảm giác hồi hộp, tim đập nhanh<br>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến<br>Đã đặt stent tim, nong động mạch vànhGiãn tĩnh mạch chân</p>', '**Tim mạch**Bác sĩ tim mạch giỏiDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà NộiLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt NamĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Khám tư vấn tim mạchKhó thở, Đau ngực, đau timTăng huyết áp, hạ huyết ápRối loạn mỡ máu, cao huyết áp, chóng mặtBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủCảm giác hồi hộp, tim đập nhanh   Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   Đã đặt stent tim, nong động mạch vànhGiãn tĩnh mạch chân   ', '2021-08-08 09:00:59', '2021-08-08 09:00:59');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(7, 'data:image/jpeg;base64,', 'Tai Mũi Họng', '<p><strong>Tai Mũi Họng</strong></p><p>Bác sĩ Chuyên khoa Tai Mũi HọngDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...Các bệnh Tai Mũi Họng</p><p>Ù tai, đau tai, chảy máu taiThủng màng nhĩ, điếc đột ngộtViêm tai giữaAmidan, V.AViêm xoangNghẹt mũiHay bị chảy máu camĐau cổ họng, khó nuốtHo kéo dàiNgủ ngáy</p>', '**Tai Mũi Họng**Bác sĩ Chuyên khoa Tai Mũi HọngDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...Các bệnh Tai Mũi HọngÙ tai, đau tai, chảy máu taiThủng màng nhĩ, điếc đột ngộtViêm tai giữaAmidan, V.AViêm xoangNghẹt mũiHay bị chảy máu camĐau cổ họng, khó nuốtHo kéo dàiNgủ ngáy', '2021-08-08 09:01:31', '2021-08-08 09:01:31');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(8, 'data:image/jpeg;base64,', 'Cột sống', '<p><strong>Cột sống</strong></p><p>Bác sĩ Chuyên khoa Cột sốngDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà NộiCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Thần kinh - Cột sống</p><p>Đau cột sống, đau thắt lưngChấn thương cột sốngCột sống bị đau, sưng, cong, vẹoĐau mỏi cổ vai gáy, bả vaiĐau tê mông xuống chânPhồng đĩa đệmTê bì tay chânThóa hóa đốt sốngThoái hóa L4, L5Thoát vị đĩa đệmVôi hóa cột sốngXẹp cột sống</p>', '**Cột sống**Bác sĩ Chuyên khoa Cột sốngDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà NộiCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Thần kinh - Cột sốngĐau cột sống, đau thắt lưngChấn thương cột sốngCột sống bị đau, sưng, cong, vẹoĐau mỏi cổ vai gáy, bả vaiĐau tê mông xuống chânPhồng đĩa đệmTê bì tay chânThóa hóa đốt sốngThoái hóa L4, L5Thoát vị đĩa đệmVôi hóa cột sốngXẹp cột sống', '2021-08-08 09:01:51', '2021-08-08 09:01:51');
INSERT INTO Specialties (Specialties.id, Specialties.image, Specialties.name, Specialties.descriptionHTML, Specialties.descriptionMarkdown, Specialties.createdAt, Specialties.updatedAt) VALUES
(9, 'data:image/jpeg;base64,', 'Y học Cổ truyền', '<p><strong>Y học Cổ truyền</strong></p><p>Bác sĩ Y học Cổ truyền giỏiDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:</p><p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>', '**Y học Cổ truyền**Bác sĩ Y học Cổ truyền giỏiDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2021-08-08 09:02:13', '2021-08-08 09:02:13');
